Here's a basic outline of how you can create a Rust app that supports the ElevenLabs API and reads the contents of the clipboard aloud using TTS:

**Step 1: Set up a new Rust project**

Create a new Rust project using `cargo`:
```bash
cargo new elevenlabs_tts
```
**Step 2: Add dependencies**

Add the following dependencies to your `Cargo.toml` file:
```toml
[dependencies]
reqwest = "0.11.10"
serde = { version = "1.0.130", features = ["derive"] }
serde_json = "1.0.85"
clipboard = "0.5.0"
tts = "0.1.0"
```
The `reqwest` crate is used for making HTTP requests to the ElevenLabs API, `serde` and `serde_json` are used for JSON serialization and deserialization, `clipboard` is used for accessing the clipboard, and `tts` is used for text-to-speech functionality.

**Step 3: Create a struct to hold API credentials**

Create a new file called `credentials.rs` with the following contents:
```rust
pub struct Credentials {
    pub api_key: String,
    pub api_secret: String,
}

impl Credentials {
    pub fn new(api_key: String, api_secret: String) -> Self {
        Credentials { api_key, api_secret }
    }
}
```
This struct will hold your ElevenLabs API credentials.

**Step 4: Create a function to make API requests**

Create a new file called `api.rs` with the following contents:
```rust
use reqwest;
use serde_json;

pub async fn make_request(
    credentials: &Credentials,
    endpoint: &str,
    data: serde_json::Value,
) -> Result<serde_json::Value, reqwest::Error> {
    let client = reqwest::Client::new();
    let url = format!("https://api.elevenlabs.io/{}", endpoint);
    let response = client
        .post(url)
        .header("Authorization", format!("Bearer {}", credentials.api_key))
        .header("Content-Type", "application/json")
        .body(data.to_string())
        .send()
        .await?;

    let json = response.json().await?;
    Ok(json)
}
```
This function makes a POST request to the ElevenLabs API with the provided endpoint, data, and credentials.

